ControlPropertyState.AutoRuleBindingString:
If(
	IsBlank(dtpPRRMProcureDTST8.SelectedDate) || IsBlank(dtpPlanSampleTrialST8.SelectedDate), 
	Notify("Please fill in all required fields", NotificationType.Error), 
	UpdateContext({existingRecordST8: LookUp(ECN_Stage8, ES008_ECNReference.Value = SelectedECNNo.ES001_ECNReference)} );
	If( 
        !IsBlank(existingRecordST8),
        Patch( ECN_Stage8, existingRecordST8, 
				{
					ES008_PRForRMProcurement: dtpPRRMProcureDTST8.SelectedDate,
					ES008_PlanForSampleTrial: dtpPlanSampleTrialST8.SelectedDate,
					ES008_SampleQty: Value(txtSampleQtyST8.Text),
					ES008_BatchQty: Value(txtBatchQtyST8.Text),					
					ES008_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},					
                    ES008_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
        ),
        Patch( ECN_Stage8, Defaults(ECN_Stage8),
				{
					Title: SelectedECNNo.ES001_ECNReference, 
					ES008_PRForRMProcurement: dtpPRRMProcureDTST8.SelectedDate,
					ES008_PlanForSampleTrial: dtpPlanSampleTrialST8.SelectedDate,
					ES008_SampleQty: Value(txtSampleQtyST8.Text),
					ES008_BatchQty: Value(txtBatchQtyST8.Text),					
					ES008_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},
                    ES008_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
			)
    );	
	If(
        !IsEmpty(Errors(ECN_Stage8)), Notify( "An error occurred while saving the record.", NotificationType.Error),
        Patch(
			ECN_Stage1, 
			LookUp(ECN_Stage1,ES001_ECNReference = SelectedECNNo.ES001_ECNReference),
            { ES001_CurrentStage: { Value: "StageClose", Id: LookUp( ECN_StageMaster, Stage_Id = "9").ID }	}
        );
        Notify("Record saved successfully!", NotificationType.Success)
    );    
	Navigate(frmHome)

)
